import React, { Component } from "react";
import { TextField } from "@material-ui/core";
import { Button } from "@material-ui/core";
import { Paper } from "@material-ui/core";
import { withStyles } from "@material-ui/styles";

const styles = {
    TextField: {
        width: '100%'
    }
}

class Register extends Component{
    constructor (props) {
		super(props)
		this.state = {
			email: '',
			login: '',
			password: '',
			password2: '',
			errors: {}
		}
    }
    render(){
        const {classes} = this.props;
        return (
            <Paper style={{padding: 8}}>
                <form>
                    <TextField type = "email" label="Email" className={classes.TextField}/>
                    <TextField type = "text" label="Logn" className={classes.TextField}/>
                    <TextField type = "password" label="Password" className={classes.TextField}/>
                    <TextField type = "password" label="Repeat Password" className={classes.TextField}/>
                    <Button variant = "outlined">
                        Submit
                    </Button>
                </form>
            </Paper>
        )
    }
}

export default withStyles(styles)(Register)
